import React from 'react';
import '../App'; 
import { Bar } from 'react-chartjs-2';

class Analytics extends React.Component{
    render(){
        return( 
           
                <center>
                <Bar
                data={{
                    labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
                }}
                height={400}
                width={600}
                options
                />
                </center>


        );
    }
}

export default Analytics;
